DROP PROCEDURE IF EXISTS `AfficherMontantApayer`;
DELIMITER |
CREATE PROCEDURE `AfficherMontantApayer`(IN p_frais_mensuel_id smallint,IN p_nom_classe varchar(15),OUT p_montant double)
BEGIN 

DECLARE v_montant double default 0; 

 SELECT cf.montant INTO v_montant from classe_frais_mensuel as cf 
		INNER JOIN frais_mensuel as fm 
			ON cf.frais_mensuel_id = fm.id 
		INNER JOIN classe as c 
			ON cf.classe_id = c.id where c.nom = p_nom_classe AND fm.id = p_frais_mensuel_id;
            
            IF v_montant != 0 OR v_montant is not null THEN
					SET p_montant = v_montant ;
				 ELSE 
					SET p_montant = 0 ;
			END IF;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `AfficherPaiementDunEleveParID`;
DELIMITER |
CREATE PROCEDURE `AfficherPaiementDunEleveParID`(IN p_id smallint)
BEGIN
select pm.id,pm.date_paie as "date",fm.designation,fm.montant 
   from paiement_mensuel as pm 
   INNER JOIN eleve as e ON e.id=pm.eleve_id
   INNER JOIN frais_mensuel as fm ON fm.id=pm.frais_mensuel_id
   WHERE e.id = p_id;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `AfficherPaiementExamenParID`;
DELIMITER |
CREATE PROCEDURE `AfficherPaiementExamenParID`(IN p_id smallint)
BEGIN

-- la requette qui affichere les infos des paiement de l'élève par son ID 

select pe.id,pe.date_paie as 'Date',fe.designation as 'Désignation' from paiement_examen as pe 
INNER JOIN frais_examen as fe
ON pe.frais_examen_id = fe.id WHERE pe.eleve_id = p_id;
    
END |
