DROP PROCEDURE IF EXISTS `JournalMensuelEtInscription`;
DELIMITER |
CREATE PROCEDURE `JournalMensuelEtInscription`(p_date date)
BEGIN

select f.designation as 'Désignation',sum(f.montant) as Montant from paiement_mensuel as p
INNER JOIN frais_mensuel as f On f.id=p.frais_mensuel_id
where date(p.date_paie)=p_date
group by f.designation
UNION
SELECT 'Total',sum(f.montant) as Montant from paiement_mensuel as p
INNER JOIN frais_mensuel as f On f.id=p.frais_mensuel_id
where date(p.date_paie)=p_date;

END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `ObtenirDesignationFraisExamen`;
DELIMITER |
CREATE PROCEDURE `ObtenirDesignationFraisExamen`( IN p_eleve_id smallint,OUT p_frais_id smallint,OUT p_frais_mensuel CHAR(25))
BEGIN

-- Déclaration des variables
  DECLARE v_nombre_paiement varchar(25) default null;
  DECLARE v_eleve_existe smallint default 0;
  SET p_frais_mensuel = 0;

-- la requete qui affecete le frais d'examen à payer de dans la variable v_frais_examen 

	select count(pe.id) INTO v_nombre_paiement from paiement_examen as pe 
		INNER JOIN frais_examen as fe 
		ON fe.id=pe.frais_examen_id
	WHERE pe.eleve_id=p_eleve_id;
    
     -- requete qui vérifie si l'elève existe 
	SELECT count(id) into v_eleve_existe from eleve where id=p_eleve_id;

-- si v_nombre_paiement est different de null
IF v_nombre_paiement is not null AND v_nombre_paiement >= 0 AND v_eleve_existe > 0 THEN

     SELECT designation INTO p_frais_mensuel from frais_examen where id = v_nombre_paiement + 1 ;
	 SELECT coalesce(id) INTO p_frais_id from frais_examen where designation = p_frais_mensuel;

     
-- si le frais mensuel vaut null 
     IF p_frais_mensuel IS NULL OR p_frais_id is  null  THEN
       SET  p_frais_mensuel = 'Frais inconnu ';
       SET p_frais_id = 0 ;
     END IF;
 ELSE 
   SET  p_frais_mensuel = 'Frais inconnu ';
       SET p_frais_id = 0 ; 
END IF;

END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `ObtenirFraisEtat`;
DELIMITER |
CREATE PROCEDURE `ObtenirFraisEtat`(IN p_eleve_id smallint,OUT p_frais_id smallint,OUT p_frais_etat CHAR(25))
BEGIN
-- Déclaration des variables
  DECLARE v_nombre_paiement varchar(25) default null;
  DECLARE v_eleve_existe smallint default 0;
  SET p_frais_etat = 0;
  
  -- compater les paiement éffectué par l'élève
  select count(pe.id) INTO v_nombre_paiement from paiement_etat as pe 
		INNER JOIN frais_etat as fe 
		ON fe.id=pe.frais_etat_id
	WHERE pe.eleve_id=p_eleve_id;
    
      -- requete qui vérifie si l'elève existe 
	SELECT count(id) into v_eleve_existe from eleve where id=p_eleve_id;
    -- si v_nombre_paiement est different de null
IF v_nombre_paiement is not null AND v_nombre_paiement >= 0 AND v_eleve_existe > 0 THEN

     SELECT designation INTO p_frais_etat from frais_etat where id = v_nombre_paiement + 1 ;
	 SELECT coalesce(id) INTO p_frais_id from frais_etat where designation = p_frais_etat;
     
     -- si le frais de l'état vaut null 
     IF p_frais_etat IS NULL OR p_frais_id is  null  THEN
       SET  p_frais_etat = 'Frais inconnu ';
       SET p_frais_id = 0 ;
     END IF;
 ELSE 
   SET  p_frais_etat = 'Frais inconnu ';
       SET p_frais_id = 0 ; 
END IF;

    
  
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `ObtenirInfosPaiementExetat`;
DELIMITER |
CREATE PROCEDURE `ObtenirInfosPaiementExetat`(IN p_eleve_id INT,OUT p_frais_exetat_id smallint,OUT p_designation_frais_exetat char(20))
BEGIN
DECLARE v_nombre_paiement smallint default 0;
-- on compte le le paiement exétat éffectué par un élève...
SELECT count(id) INTO v_nombre_paiement  from paiement_exetat where eleve_id= p_eleve_id;

-- si nombre de paiement ne vaut pas null
IF v_nombre_paiement IS not null THEN
	-- si le nombre de paiement vaut 0 c'est-à-dire qu'il pas encore payé on selectionne montant,id frais...
    SET p_frais_exetat_id = v_nombre_paiement +  1; -- + 1 car il vaut 0 par défaut
    SELECT designation INTO p_designation_frais_exetat FROM frais_exetat where id = p_frais_exetat_id;

ELSE
-- On reunitialise 
Set p_frais_exetat_id = 0 ;
set p_designation_frais_exetat ='Inconnu';
END if;

END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `ObtenirMontantFraisEtat`;
DELIMITER |
CREATE PROCEDURE `ObtenirMontantFraisEtat`(IN p_classe char(15),IN p_frais_examen char(25),OUT p_montant double)
BEGIN
SET p_montant = 0;
--  la requette qui obtient le montant...

IF P_frais_examen IS NOT NULL  AND P_frais_examen !='Frais inconnu' THEN
	select cf.Montant INTO p_montant from classe_frais_etat as cf 
		  INNER JOIN frais_etat as fe 
        ON fe.id=cf.frais_etat_id 
		  INNER JOIN classe as c 
		ON c.id=cf.classe_id
	WHERE c.nom=p_classe AND fe.designation like p_frais_examen;
    ELSE
    SET p_montant = 0;
    
END IF;
END |
DELIMITER ;

