DROP PROCEDURE IF EXISTS `Ps_JournalCentralise`;
DELIMITER |
CREATE PROCEDURE `Ps_JournalCentralise`(IN p_date date)
BEGIN


-- la declaration des varaiables
DECLARE v_Total_Paiement_examen decimal default 0;
DECLARE v_Total_Paiement_examen_etat decimal default 0;
DECLARE v_Total_Paiement_frais_etat decimal default 0;
DECLARE v_Total_Paiement_manuel decimal default 0;
DECLARE v_Total_Paiement_frais_mensuel decimal default 0;
DECLARE v_Total_Paiement_frais_inscription decimal default 0;
DECLARE v_Total_Paiement_frais_DAP decimal default 0;
DECLARE v_Total_accompte decimal default 0;
DECLARE v_Total_general decimal default 0;


-- déclaration des variables qui vont prendre le nombre  des réçu pour chaque frais

DECLARE   v_nombre_recu_inscription int  default 0;
DECLARE   v_nombre_recu_frais_mensuel int  default 0;
DECLARE   v_nombre_recu_examen_etat int  default 0;
DECLARE   v_nombre_recu_Paiement_manuel int  default 0;
DECLARE   v_nombre_recu_Paiement_examen int  default 0;
DECLARE   v_nombre_recu_Paiement_frais_etat int  default 0;
DECLARE	  v_nombre_recu_DAP int default 0;
DECLARE	  v_nombre_total_recu int default 0;
DECLARE   v_nombre_total_accompte int default 0;
/*
selection des nombre des récu pour chaque frais
*/


-- Le bloc du total frais d'examen
frais_examen:BEGIN
	SELECT sum(cfe.montant) INTO v_Total_Paiement_examen
		FROM PAIEMENT_EXAMEN as pe 
			INNER JOIN eleve as e ON pe.eleve_id=e.id
			INNER JOIN frais_examen as fe ON pe.frais_examen_id=fe.id 
			INNER JOIN classe AS c On e.classe_id=c.id
            INNER JOIN classe_frais_examen as cfe ON cfe.classe_id=c.id AND cfe.frais_examen_id=fe.id
		WHERE date( pe.date_paie)=p_date;
        
        SELECT count(*) INTO v_nombre_recu_Paiement_examen
		FROM PAIEMENT_EXAMEN as pe 
			INNER JOIN eleve as e ON pe.eleve_id=e.id
			INNER JOIN frais_examen as fe ON pe.frais_examen_id=fe.id 
			INNER JOIN classe AS c On e.classe_id=c.id
            INNER JOIN classe_frais_examen as cfe ON cfe.classe_id=c.id AND cfe.frais_examen_id=fe.id
		WHERE date( pe.date_paie)=p_date;
END;
frais_frais_etat:BEGIN
	select
	SUM(cfe.montant) INTO v_Total_Paiement_frais_etat
	from paiement_etat as pe
		INNER JOIN eleve as e On pe.eleve_id=e.id
		INNER JOIN classe as c ON e.classe_id=c.id
		INNER JOIN frais_etat as fe ON pe.frais_etat_id=fe.id
        INNER JOIN classe_frais_etat as cfe ON cfe.classe_id=c.id AND cfe.frais_etat_id=fe.id
	WHERE date(pe.date_paie)=p_date;
    
    	select
	count(*) INTO v_nombre_recu_Paiement_frais_etat
	from paiement_etat as pe
		INNER JOIN eleve as e On pe.eleve_id=e.id
		INNER JOIN classe as c ON e.classe_id=c.id
		INNER JOIN frais_etat as fe ON pe.frais_etat_id=fe.id
        INNER JOIN classe_frais_etat as cfe ON cfe.classe_id=c.id AND cfe.frais_etat_id=fe.id
	WHERE date(pe.date_paie)=p_date;
    
END;
-- le bloc du frais de vente des menuels
frais_manuel:BEGIN
select 
	SUM(pm.quantite* m.prix_unitaire) INTO v_Total_Paiement_manuel
	from paiement_manuels as pm
	INNER JOIN eleve AS e ON pm.eleve_id=e.id
	INNER JOIN CLASSE AS c ON e.classe_id=c.id
	INNER JOIN manuels AS m ON pm.manuel_id=m.id
WHERE date(pm.date_paie)=p_date;

select 
	count(*) INTO v_nombre_recu_Paiement_manuel
	from paiement_manuels as pm
	INNER JOIN eleve AS e ON pm.eleve_id=e.id
	INNER JOIN CLASSE AS c ON e.classe_id=c.id
	INNER JOIN manuels AS m ON pm.manuel_id=m.id
WHERE date(pm.date_paie)=p_date;


END;
-- le bloc du frais mensuel
frais_mansuel:BEGIN
	select sum(f.Montant) INTO v_Total_Paiement_frais_mensuel
		from paiement_mensuel as pm
		INNER JOIN  eleve as e ON pm.eleve_id=e.id
		INNER JOIN frais_mensuel as f ON pm.frais_mensuel_id=f.id
		INNER JOIN classe as c ON e.classe_id=c.id
	WHERE date(pm.date_paie) =date(p_date) and f.designation!='Inscription'  AND 
    pm.frais_mensuel_id NOT IN (
		SELECT  a.frais_mensuel_id 
		from accompte a where  a.frais_mensuel_id=pm.frais_mensuel_id 
		and a.eleve_id=e.id 
		and date(a.date_paie)=date(p_date)
    );
    
    -- le nombre de recu 
    select count(*) INTO v_nombre_recu_frais_mensuel
		from paiement_mensuel as pm
		INNER JOIN  eleve as e ON pm.eleve_id=e.id
		INNER JOIN frais_mensuel as f ON pm.frais_mensuel_id=f.id
		INNER JOIN classe as c ON e.classe_id=c.id
	WHERE date(pm.date_paie) = p_date and f.designation!='Inscription';
END;
frais_inscription:BEGIN
select sum(f.Montant) INTO v_Total_Paiement_frais_inscription
		from paiement_mensuel as pm
		INNER JOIN  eleve as e ON pm.eleve_id=e.id
		INNER JOIN frais_mensuel as f ON pm.frais_mensuel_id=f.id
		INNER JOIN classe as c ON e.classe_id=c.id
	WHERE f.designation='Inscription' AND date(pm.date_paie) = p_date ;
    
    -- nombre de recu 
    select count(*) INTO v_nombre_recu_inscription
		from paiement_mensuel as pm
		INNER JOIN  eleve as e ON pm.eleve_id=e.id
		INNER JOIN frais_mensuel as f ON pm.frais_mensuel_id=f.id
		INNER JOIN classe as c ON e.classe_id=c.id
	WHERE f.designation='Inscription' AND date(pm.date_paie) = p_date ;
END;
-- le bloc du frais exetat
frais_exetat:BEGIN
	select sum(cf.montant) INTO v_Total_Paiement_examen_etat
		from paiement_exetat as pe
		INNER JOIN eleve as e ON pe.eleve_id=e.id
		INNER JOIN classe as c on e.classe_id=c.id
		INNER JOIN frais_exetat as fe ON pe.frais_exetat_id=fe.id
		INNER JOIN classe_frais_exetat cf on cf.frais_exetat_id=fe.id AND cf.classe_id=c.id
	where date(pe.date_paie)=p_date;
    
    -- le nombre des recus 
    select count(*) INTO v_nombre_recu_examen_etat
		from paiement_exetat as pe
		INNER JOIN eleve as e ON pe.eleve_id=e.id
		INNER JOIN classe as c on e.classe_id=c.id
		INNER JOIN frais_exetat as fe ON pe.frais_exetat_id=fe.id
		INNER JOIN classe_frais_exetat cf on cf.frais_exetat_id=fe.id AND cf.classe_id=c.id
	where date(pe.date_paie)=p_date;
END;

-- bloc accompte 
accompte : begin
select count(id) INTO v_nombre_total_accompte from accompte where date(date_paie) = date(p_date);
select sum(montant) INTO v_Total_accompte from accompte where date(date_paie)=date(p_date);
end;

affichage:BEGIN
-- cacul du total général 
 DECLARE v_Total_general  decimal default 0;
 
 IF v_Total_Paiement_frais_mensuel IS NULL THEN
	SET v_Total_Paiement_frais_mensuel = 0;
 END IF;
 IF v_Total_Paiement_frais_etat IS NULL THEN
	SET v_Total_Paiement_frais_etat = 0;
 END IF;
 IF v_Total_Paiement_examen IS NULL THEN
	SET v_Total_Paiement_examen = 0;
 END IF;
 IF v_Total_Paiement_examen_etat IS NULL THEN
	SET v_Total_Paiement_examen_etat = 0;
 END IF;
 IF v_Total_Paiement_manuel IS NULL THEN
	SET v_Total_Paiement_manuel = 0;
 END IF;
 IF v_Total_Paiement_frais_inscription IS NULL THEN
	SET v_Total_Paiement_frais_inscription = 0;
 END IF;
 

 
 IF v_Total_accompte IS NULL THEN 
	SET v_Total_accompte :=0;
 END IF;
 


  
 
 /* 
 ce bloc permet de trouver le nombre de réçu pour chaque paiement
 */


 
 nombre_de_recu:begin
 
 end;
 SET v_Total_general = v_Total_Paiement_frais_mensuel + v_Total_Paiement_frais_inscription + v_Total_Paiement_frais_etat + v_Total_Paiement_examen + v_Total_Paiement_examen_etat + v_Total_Paiement_manuel+v_Total_accompte;
 SET v_nombre_total_recu = v_nombre_recu_inscription + v_nombre_recu_DAP +v_nombre_recu_Paiement_examen+ v_nombre_recu_frais_mensuel +v_nombre_recu_Paiement_frais_etat+ v_nombre_recu_Paiement_manuel + v_nombre_recu_Paiement_examen + v_nombre_recu_examen_etat + v_nombre_total_accompte;
		SELECT 0 AS 'N°','Frais Inscription' AS 'Intitulé frais',v_nombre_recu_inscription as 'Nombre de Reçu',v_Total_Paiement_frais_inscription as Total
        UNION
		SELECT 1 AS 'N°','Frais mensuel' AS 'Intitulé frais',v_nombre_recu_frais_mensuel as 'Nombre de Reçu',v_Total_Paiement_frais_mensuel as Total
        UNION
		SELECT 2,'Frais de l''état' AS'Intitulé frais',v_nombre_recu_Paiement_frais_etat as 'Nombre de Reçu',v_Total_Paiement_frais_etat as Total
        UNION
		SELECT 3,'Frais frais d''examen' AS 'Intitulé frais',v_nombre_recu_Paiement_examen as 'Nombre de Reçu' ,v_Total_Paiement_examen as Total
        UNION
		SELECT 4,'Frais examen d''état' AS 'Intitulé frais',v_nombre_recu_examen_etat as 'Nombre de Reçu',v_Total_Paiement_examen_etat as Total
        UNION
		SELECT 5,'vente des manuels' AS 'Intitulé frais',v_nombre_recu_Paiement_manuel as  'Nombre de Reçu',v_Total_Paiement_manuel as Total
        UNION
        SELECT 7,'Accompte' AS 'Intitulé frais',v_nombre_total_accompte as  'Nombre de Reçu', v_Total_accompte as Total
        UNION
        SELECT 8,'TOTAL' AS 'Intitulé frais',v_nombre_total_recu as 'Nombre de Reçu',v_Total_general as Total;

END;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `PS_JournalDesFrais`;
DELIMITER |
CREATE PROCEDURE `PS_JournalDesFrais`(IN p_index_frais tinyint,IN p_date date)
BEGIN

                
-- calucl du total inscription et frais mensuel pour les  élèves 
SELECT  sum(f.montant) into @total__inscription_ancien_eleve 
				FROM paiement_mensuel as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN frais_mensuel as f ON p.frais_mensuel_id=f.id
				WHERE date(p.date_paie) = date(p_date) 	and f.designation='Inscription';

-- calucl du total inscription et frais mensuel pour les   élèves 
SELECT  sum(f.montant) into @total__mensuel
				FROM paiement_mensuel as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN frais_mensuel as f ON p.frais_mensuel_id=f.id
				WHERE date(p.date_paie) = date(p_date) 	and f.designation != 'Inscription';

-- calcul du montant total entree 
IF @total__mensuel IS NULL THEN
	set @total__mensuel:=0;
END IF;

IF @total__inscription_ancien_eleve  IS NULL THEN
	set @total__inscription_ancien_eleve:=0;
END IF;

set @total_entre:= @total__mensuel +  @total__inscription_ancien_eleve ;
                
	CASE p_index_frais
		WHEN 0 THEN -- frais mensuel
        
			frais_mensuel :BEGIN  -- le bloc du frais mensuel
            SELECT  
				p.id as 'N°',time(p.date_paie) as Heure,e.id ,concat_ws(' ',e.nom,e.postnom,e.prenom) as Noms,c.nom as Classe,f.designation,f.Montant,u.nom users
				FROM paiement_mensuel as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
                    INNER JOIN users u ON u.id=p.user_id
					INNER JOIN frais_mensuel as f ON p.frais_mensuel_id=f.id 
                    WHERE date(p.date_paie) = p_date
					UNION
                    SELECT '-' as 'N°','-' as Heure,'-' as Noms,'-'as Classe,'-','TOTAL' as designation ,round(@total_entre,2),""  as Montant
				FROM paiement_mensuel as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN frais_mensuel as f ON p.frais_mensuel_id=f.id
				WHERE date(p.date_paie) = p_date;
            END;
            
        WHEN 1 THEN   -- frais d'examen 
			frais_examen:BEGIN
            SELECT  
					p.id as 'N°',time(p.date_paie) as Heure,e.id ,concat_ws(' ',e.nom,e.postnom,e.prenom) as Noms,c.nom as Classe,f.designation,cf.Montant,u.nom users
					FROM paiement_examen as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN frais_examen as f ON p.frais_examen_id=f.id
					INNER JOIN users u ON u.id=p.user_id
					INNER JOIN classe_frais_examen as cf ON cf.classe_id=c.id And P.frais_examen_id=cf.frais_examen_id
					WHERE date(p.date_paie) = p_date 
                    UNION
					SELECT '-' as 'N°','-' as Heure,'-' as Noms,'-'as Classe,'-','TOTAL' as designation ,sum( cf.Montant) as Montant,u.nom users
					FROM paiement_examen as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
                    INNER JOIN users u ON u.id=p.user_id
					INNER JOIN frais_examen as f ON p.frais_examen_id=f.id
					INNER JOIN classe_frais_examen as cf ON cf.classe_id=c.id And P.frais_examen_id=cf.frais_examen_id
					WHERE date(p.date_paie) = p_date ;
            END;
		WHEN 2 THEN  -- frais d'examen d'etat 
			frais_etat:BEGIN
            
            SELECT  
					p.id as 'N°',time(p.date_paie) as Heure,e.id ,concat_ws(' ',e.nom,e.postnom,e.prenom) as Noms,c.nom as Classe,f.designation,cf.Montant,u.nom users
					FROM paiement_exetat as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
                    INNER JOIN users u ON u.id=p.user_id
					INNER JOIN frais_exetat as f ON p.frais_exetat_id=f.id
					INNER JOIN classe_frais_exetat as cf ON cf.classe_id=c.id And P.frais_exetat_id=cf.frais_exetat_id
					WHERE date(p.date_paie) =p_date; 
            END;
		WHEN 3 THEN   -- frais des manuels
			SELECT  
					p.id as 'N°',time(p.date_paie) as Heure,e.id ,concat_ws(' ',e.nom,e.postnom,e.prenom) as Noms,c.nom as Classe,
					m.intitule as 'Intitulé',m.prix_unitaire as 'Prix Unitaire',p.quantite as 'Quantité',
					p.quantite*m.prix_unitaire as 'Prix Total'
					FROM paiement_manuels as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN manuels as m ON p.manuel_id=m.id
					WHERE date(p.date_paie) = p_date;
		WHEN 4 THEN   -- frais de l'état
        frais_etat: BEGIN
        
			SELECT 
					p.id as 'N°',time(p.date_paie) as Heure,e.id ,concat_ws(' ',e.nom,e.postnom,e.prenom) as Noms,c.nom Classe,f.designation ,cf.Montant
					FROM paiement_etat as p 
					INNER JOIN eleve as e on p.eleve_id=e.id
					INNER JOIN  classe as c ON e.classe_id=c.id
					INNER JOIN frais_etat as f ON p.frais_etat_id=f.id
					INNER JOIN classe_frais_etat as cf ON cf.classe_id=c.id And P.frais_etat_id=cf.frais_etat_id
					WHERE date(p.date_paie) = p_date;
				END;
        ELSE
			SELECT 'vueillez selectionner le frais s''il vous plait !!!! ' as message;
        END CASE ;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `PS_ListeInsolvablesparMois`;
DELIMITER |
CREATE PROCEDURE `PS_ListeInsolvablesparMois`(IN p_mois char(20),IN p_classe varchar(20))
BEGIN
IF p_mois <> '' and p_mois is not null and p_classe<> '' and p_classe is not null THEN

	SELECT distinct e.id, concat_ws(' ', e.nom,e.postnom,e.prenom) as Noms,e.genre as Genre,c.nom as classe 
    from eleve as e 
	INNER JOIN classe as c ON e.classe_id=c.id
	INNER JOIN paiement_mensuel as pm ON pm.eleve_id=e.id
	INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
	WHERE e.id not in
	(
	select e.id from eleve AS e 
	INNER JOIN paiement_mensuel as pm ON pm.eleve_id=e.id 
	INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
	INNER JOIN classe as c on e.classe_id=c.id
	WHERE fm.designation=p_mois 
	) 
    and e.id not in(select eleve_id from associer)

	order by classe,noms;

    ELSE
	SELECT distinct e.id, concat_ws(' ', e.nom,e.postnom,e.prenom) as Noms,e.genre as Genre,c.nom as classe 
    from eleve as e 
	INNER JOIN classe as c ON e.classe_id=c.id
	INNER JOIN paiement_mensuel as pm ON pm.eleve_id=e.id
	INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
	WHERE e.id not in
	(
	select e.id from eleve AS e 
	INNER JOIN paiement_mensuel as pm ON pm.eleve_id=e.id 
	INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
	INNER JOIN classe as c on e.classe_id=c.id
	WHERE fm.designation=p_mois 
	)  
       and e.id not in(select eleve_id from associer)
	order by classe,noms;
END IF;

END |
DELIMITER ;

DROP PROCEDURE IF EXISTS `ps_ListerInfoPaiement`;
DELIMITER |
CREATE PROCEDURE `ps_ListerInfoPaiement`(IN p_eleve_id smallint,OUT p_Total decimal)
BEGIN
select 
pm.id,pm.date_paie as 'Date',fm.designation as 'Désignation',IF(Pm.paye=true,cfm.Montant,0) AS Montant from paiement_mensuel as pm
INNER JOIN  eleve as e ON pm.eleve_id=e.id
INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
INNER JOIN classe as c ON e.classe_id=c.id
INNER JOIN classe_frais_mensuel as cfm on cfm.classe_id=c.id AND cfm.frais_mensuel_id=fm.id
WHERE e.id=p_eleve_id;

-- Calcul du totol 
SELECT
SUM(IF(Pm.paye=true,cfm.Montant,0)) INTO p_Total from paiement_mensuel as pm
INNER JOIN  eleve as e ON pm.eleve_id=e.id
INNER JOIN frais_mensuel as fm ON pm.frais_mensuel_id=fm.id
INNER JOIN classe as c ON e.classe_id=c.id
INNER JOIN classe_frais_mensuel as cfm on cfm.classe_id=c.id AND cfm.frais_mensuel_id=fm.id
WHERE e.id=p_eleve_id;

END |
DELIMITER ;

